// Components
import UserPortfolioContainer from './UserPortfolioContainer';
import UserPortfolioView from './UserPortfolioView';
import PortfolioNavbar from './PortfolioNavbar';
import PortfolioFooter from './PortfolioFooter';
import EducationSection from './components/EducationSection';
import ExperienceSection from './components/ExperienceSection';
import ProjectSection from './components/ProjectSection';
import SkillsSection from './components/SkillsSection';
import TestimonialsSection from './components/TestimonialsSection';

// Helpers
import { someUtilityFunction } from './helpers/analyticsHelper';

// Services
import { fetchPortfolioData } from './services/portfolioService';

// Redux related imports
import userPortfolioSlice from './userPortfolioSlice';
import { userPortfolioThunks } from '../userPortfolioThunks';

// Exporting components
export {
  UserPortfolioContainer,
  UserPortfolioView,
  PortfolioNavbar,
  PortfolioFooter,
  EducationSection,
  ExperienceSection,
  ProjectSection,
  SkillsSection,
  TestimonialsSection,
  // Helpers
  someUtilityFunction,
  // Services
  fetchPortfolioData,
  // Redux related exports
  userPortfolioSlice,
  userPortfolioThunks,
};

// Typically, you might have a default export for the main container component
export default UserPortfolioContainer;
